clear all
close all

data = importdata("dati_Rb.m",',') %[output:62bff15b]
m = data.data %[output:641dc6a4]
% Extract specific columns from the imported data
Vcont = m(:, 1) %[output:66c8ad41]
S_Rb = m(:, 2) %[output:695ad4df]
S_Rb = S_Rb*(-1) %[output:20c0b75e]
S_FP = m(:, 3) %[output:5ffdd822]
S_FP = S_FP + 0.4 %[output:9852fbf6]

plot(Vcont, S_FP, '-') %[output:5bf069b8]

[V_p N] = findpeaks(S_FP, 'MinPeakHeight',0.2) %[output:41120262]

V_p1 = flip(V_p)

plot(N,V_p1,'.')

p = polyfit(N, V_p1, 1)

hold on

y = p(1,1).*N + p(1,2)

plot(N, y, '-')

f = Vcont/(2*1e-4)

hold off

plot(f,S_Rb,'.')



